import React from 'react';
import './login.css';

const Login = () => {
  return (
    <div className='login'>
      <div className='login_card'>
        <div className='titleCard_login'>
        <YouTubeIcon sx={{fontSize: "54px", color: "red"}}/>
        </div>
      </div>
    </div>
  )
}

export default Login;
